Интерфейсы

Ключевое слово interface используется для создания полностью абстрактных классов без любой реализации. При создании интерфейса определяются только имена методов, списки аргументов и типы возвращаемых значений. Интерфейс описывает форму, но не реализацию. interface: «Именно так должны выглядеть все классы, которые реализуют данный интерфейс». Для создания интерфейса ключевое слово interface используется вместо class. Интерфейс также может содержать поля, но они автоматически являются статическими (static) и неизменными (final). Для создания класса, реализующего определенный интерфейс используется ключевое слово implements. implements: «Интерфейс лишь определяет форму, а здесь будет показано, как это работает». При описании методов в интерфейсе можно не объявлять их открытыми (определяются автоматически). При реализации интерфейса его методы должны быть объявлены как public.














